import React from "react";
import { Text, View } from "react-native";
import { ThemeProvider, Button } from "react-native-elements";


function Landing() {
  return (
    <View>
      <ThemeProvider>
        <Button title="My Button" />
        <Button title="My 2nd Button" />
      </ThemeProvider>
    </View>
  );
}

export default Landing;
